import { projects } from '../Data/projects_list';

function Projects(){
    const mappedProjects = projects.map(proj=> {
        <li key={proj.name}>{proj.name}</li>
    })
    return(
        <ul>{mappedProjects}</ul>
    );
}
export default Projects;
